lookingForMore:"Looking for more?",checkOutLabsCatalog:"Check out the Bluemix Labs Catalog to try out experimental runtimes and services.",labsCatalog:"Bluemix Labs Catalog",labsCatalogWarning:"\x3cspan\x3eAttention\x3c/span\x3e: Experimental runtimes and services might be unstable or change frequently, and might be discontinued at short notice.",backToCatalog:"Return to the Bluemix Catalog",bluemixCatalog:"Bluemix Catalog",pricingGBHourHeader:"What is a GB-hour?",pricingGBHourExplanation:"\x3cspan\x3eRuntimes are billed in GB-hours.\x3c/span\x3e If your app uses 1GB of memory and runs for 1 hour, you just used 1 GB-hour. Run with 2GB of memory for 2 hours and you just used 4 GB-hours. Run 2 Instances of your app using 2GB each for 2 hours and you're at 8 GB-hours. It's that simple!",
