runtimeChargesGuidance:"A good starting point is a 512 MB instance for applications using Liberty For Java\x26trade;, or a 64 MB instance for applications using SDK for Node.js\x26trade; and other runtimes. Choose three instances if you need high availability.",runtimeChargeInGBHours:"\x3cb\x3eRuntime Charge in GB-Hours\x3c/b\x3e\x3cbr/\x3e\x3cbr/\x3eYou are charged for the time that your apps run and the memory that is used, calculated as GB-hours. You customize the number of instances and the amount of memory per instance based on your needs. You can also add memory or instances to scale for more users. The final charge is per GB-hour: your app instances, multiplied by memory per instance, multiplied by hours running.\x3cbr/\x3e\x3cbr/\x3eFor example, consider a runtime that costs $0.07 per GB-hour and two 512 MB instances, running for 30 days (720 hours). These resources would cost about $24 USD, including a free allowance of 375 GB-hours, with the following calculations: \x3cbr/\x3e2 instances x 0.5 GB x 720 hours \x3d 720 GB-hours. \x3cbr/\x3eFree allowance of 375 GB-hours. \x3cbr/\x3e345 GB-hours charged $0.07 per GB-hour \x3d $24.15.",
